import axiosInstance from "../config/axios"

const getRubriques = () => {

    return axiosInstance
        .get('/rubriques')
        .then(response => response.data)
}

const getArticles = () => {

    return axiosInstance
        .get('/rubriques')
        .then(response => response.data)
}

export default { getRubriques , getArticles }
